INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "フリーマーケット会場", 10118, 5118061, "ペコリーヌとの出会い", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 2834, 2, 1, 40, "青空の下で謁見", 0, 8, 7, 20063115);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "フリーマーケット会場", 10118, 5118062, "マホとの出会い", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 2835, 2, 1, 40, "未来の騎空団\nマスコット？", 0, 8, 7, 20063115);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "ランドソル市街地", 10118, 5118063, "アキノとの出会い", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 2837, 2, 1, 40, "お嬢さまからの\n緊急依頼", 0, 8, 7, 20063115);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "フリーマーケット会場", 10118, 5118064, "ジュンとの出会い", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 4108402, 2, 1, 40, "黄金色の悩みごと", 0, 8, 18, 20063115);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "フリーマーケット会場", 10118, 5118065, "カオリとの出会い", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 4107402, 2, 1, 40, "白熱！　格闘大会！", 0, 8, 18, 20063115);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "オーエド町", 10118, 5118066, "ニノンとの出会い", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 9000227, 2, 1, 40, "祭り太鼓はオーエドの華", 1, 8, 16, 20063115);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "フリーマーケット会場", 10118, 5118067, "スズナとの出会い", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 2101181, 3, 1, 40, "人気者は遅れて\nやってくる", 0, 8, 19, 20063115);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "ランドソル市街地", 10118, 5118068, "ナナカとの出会い", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 4109402, 3, 1, 40, "巫女・ミーツ・魔法少女", 0, 8, 18, 20063115);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "フリーマーケット会場", 10118, 5118069, "キャル＆コッコロとの出会い", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 4305402, 3, 1, 40, "ネズ耳は二度なくなる", 0, 8, 18, 20063115);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "ランドソル市街地", 10118, 5118070, "ユカリとの出会い", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 4101402, 3, 1, 40, "この出会いにカンパイ！", 0, 8, 18, 20063115);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "ランドソル市街地", 10118, 5118071, "アオイとの出会い", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 4106402, 3, 1, 40, "陰陽アンサンブル", 0, 8, 18, 20063115);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, "フリーマーケット会場", 10118, 5118072, "シノブとの出会い", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 2836, 3, 1, 40, "運試し十番勝負！", 1, 8, 7, 20063115);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (0, 0, 10118, 5118600, "オープニング", 0, 0, 1, 0, 0, "彼女たちの新たな日常", 0, 0, 0, 20063115);
